import React from 'react';
//components
import Header from '../components/header.react';
//styles
import '../styles/home.css';

const Home = ({ isActive }) => {

  useEffect(() => {
    getData(isActive);
  }, [isActive])
  return (
    <div className='home'>
      <div className='home-header'>
        <Header headerContent="Hello, I'm Jaime" isActive={isActive} />
      </div>
    </div>
  );
}

export default Home;
